class LandingGearODE(om.ExplicitComponent):

    x_init = 0.0
    v_init = 0.0
    m = 150.0
    mL = 0
    l1 = 0.305
    l2 = 0.102
    k1 = 5e4
    k2 = 5e4
    c1 = 1e3
    c2 = 1e3
    u_lower = -100.0
    u_upper =  100.0
    #uobjscalar = 0

    def initialize(self):
        self.options.declare('num_nodes', types=int)

    def setup(self):
        nn = self.options['num_nodes']

        # Parameters
        self.add_input('g', val=9.8, desc='gravitational acceleration', units='m/s**2')
        self.add_input('m', val=self.m, desc='payload mass', units='kg')
        self.add_input('mL', val=self.mL, desc='leg mass', units='kg')
        self.add_input('l1', val=self.l1, desc='length of the bar', units='m')
        self.add_input('l2', val=self.l2, desc='length of the bar', units='m')
        self.add_input('k1', val=self.k1, desc='spring constant', units='N/m')
        self.add_input('k2', val=self.k2, desc='spring constant', units='N/m')
        self.add_input('c1', val=self.c1, desc='damping constant', units='N*s/m')
        self.add_input('c2', val=self.c2, desc='damping constant', units='N*s/m')

        # States
        self.add_input('x', val=np.zeros(nn), desc='vertical position of CG', units='m')
        self.add_input('v', val=np.zeros(nn), desc='vertical velocity of CG', units='m/s')

        # Controls
        self.add_input('u1', val=np.zeros(nn), desc='control force on spring 1', units='N')
        self.add_input('u2', val=np.zeros(nn), desc='control force on spring 2', units='N')

        # Outputs
        self.add_output('xdot', val=np.zeros(nn), desc='xdot', units='m/s')
        self.add_output('vdot', val=np.zeros(nn), desc='vdot', units='m/s**2')

        # Objective
        #self.add_output('vSquareIntdot', val=np.zeros(nn), desc='derivative of objective', units='m**2/s**2')
        self.add_output('uSquareIntdot', val=np.zeros(nn), desc='derivative of objective', units='N**2/s')
        #self.add_output('SquareIntdot', val=np.zeros(nn), desc='derivative of objective')

        # Declate partials
        arange = np.arange(self.options['num_nodes'], dtype=int)
        self.declare_partials(of='xdot', wrt='v', rows=arange, cols=arange)
        self.declare_partials(of= 'xdot', wrt='x', rows=arange, cols=arange)
        self.declare_partials(of='vdot', wrt='x', rows=arange, cols=arange)
        self.declare_partials(of='vdot', wrt='v', rows=arange, cols=arange)
        self.declare_partials(of='vdot', wrt='u1', rows=arange, cols=arange)
        self.declare_partials(of='vdot', wrt='u2', rows=arange, cols=arange)
        #self.declare_partials(of='vSquareIntdot', wrt='v', rows=arange, cols=arange)
        self.declare_partials(of='uSquareIntdot', wrt='u1', rows=arange, cols=arange)
        self.declare_partials(of='uSquareIntdot', wrt='u2', rows=arange, cols=arange)
