# Setup parser
parser = argparse.ArgumentParser()
parser.add_argument('--optimizer', default='IPOPT',
                choices=['SLSQP', 'SNOPT', 'IPOPT', 'ParOpt'],
                help='optimizer')
parser.add_argument('--simulation-only', action='store_true',
                help='skip optimization, only perform simulation')
args = parser.parse_args()
optimizer = args.optimizer
simulation_only = args.simulation_only

# Setup problem
p = om.Problem(model=om.Group())

traj = dm.Trajectory()
p.model.add_subsystem('traj', subsys=traj)
phase = dm.Phase(ode_class=LandingGearODE,
                 transcription=dm.GaussLobatto(num_segments=40, order=3))
traj.add_phase(name='phase0', phase=phase)
phase.set_time_options(fix_initial=True, fix_duration=True, duration_val=4, units='s')
phase.add_state('x', units='m',   rate_source='xdot', targets=['x'], fix_initial=True)
phase.add_state('v', units='m/s', rate_source='vdot', targets=['v'], fix_initial=True)
#phase.add_state('vSquareInt', units='m**2/s', rate_source='vSquareIntdot', fix_initial=True)
phase.add_state('uSquareInt', units='N**2', rate_source='uSquareIntdot', fix_initial=True)
#phase.add_state('SquareInt', rate_source='SquareIntdot', fix_initial=True)
phase.add_control('u1', units='N', lower=LandingGearODE.u_lower,
                  upper=LandingGearODE.u_upper, targets=['u1'])
phase.add_control('u2', units='N', lower=LandingGearODE.u_lower,
                  upper=LandingGearODE.u_upper, targets=['u2'])
if not simulation_only:
    phase.add_objective('uSquareInt', loc='final')
    p.driver = om.pyOptSparseDriver()
    p.driver.options['optimizer'] = optimizer
p.setup()

# Initialize
p['traj.phase0.states:x'] = phase.interpolate(ys=[LandingGearODE.x_init, LandingGearODE.x_init], nodes='state_input')
p['traj.phase0.states:v'] = phase.interpolate(ys=[LandingGearODE.v_init, LandingGearODE.v_init], nodes='state_input')
#p['traj.phase0.states:vSquareInt'] = phase.interpolate(ys=[0,0], nodes='state_input')
p['traj.phase0.states:uSquareInt'] = phase.interpolate(ys=[0,0], nodes='state_input')
#p['traj.phase0.states:SquareInt'] = phase.interpolate(ys=[0,0], nodes='state_input')

# Run simulation
p.run_driver()
sim_out = traj.simulate()

